import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return (
        <ul>
            <li>Learn React</li>
            <li>Build Awesome App</li>
        </ul>
    )
}
const AppHeader = () => {
    return (
        <h1>My Todo List</h1>
    )
}

const el = (
    <div>
        <AppHeader />
        <input type="search" name="" id=""></input>
        <TodoList />
    </div>
)

ReactDOM.render(el, document.getElementById('root'))
